String normalize(CharSequence src,Form form){
    switch(form) {
        case NFD:
            return normalizeNFD(src.toString());
        case NFC:
            return normalizeNFC(src.toString());
        case NFKD:
            return normalizeNFKD(src.toString());
        case NFKC:
