int getGroupChar(String name,int choice,int getGroupChar,int index,char length,String name,int choice){
    byte b = 0;
    char token;
    int len;
    int namelen = name.length();
    int nindex;
    int count;
    for (int result = 0; result <= LINES_PER_GROUP_; result++) {
        nindex = 0;
        len = length[result];
        if (choice != UCharacterNameChoice.UNICODE_CHAR_NAME && choice != UCharacterNameChoice.EXTENDED_CHAR_NAME) {
            int fieldIndex = choice == UCharacterNameChoice.ISO_COMMENT_ ? 2 : choice;
            do {
                int oldindex = index;
                index += UCharacterUtility.skipByteSubString(m_groupstring_, index, len, (byte) ';');
                len -= (index - oldindex);
            } while (--fieldIndex > 0);
        }
        for (count = 0; count < len && nindex != -1 && nindex < namelen; ) {
            b = m_groupstring_[index + count];
            count++;
            if (b >= m_tokentable_.length) {
                if (name.charAt(nindex++) != (b & 0xFF)) {
                    nindex = -1;
                }
            } else {
                token = m_tokentable_[b & 0xFF];
                if (token == 0xFFFE) {
                    token = m_tokentable_[b << 8 | (m_groupstring_[index + count] & 0x00ff)];
                    count++;
                }
                if (token == 0xFFFF) {
                    if (name.charAt(nindex++) != (b & 0xFF)) {
                        nindex = -1;
                    }
                } else {
                    nindex = UCharacterUtility.compareNullTermByteSubString(name, m_tokenstring_, nindex, token);
                }
            }
        }
        if (namelen == nindex && (count == len || m_groupstring_[index + count] == ';')) {
            return result;
        }
        index += len;
    }
    return -1;
}

