StringBuffer intervalFormatByAlgorithm(Calendar fromCalendar,Calendar toCalendar,StringBuffer appendTo,FieldPosition pos){
    if (!fromCalendar.isEquivalentTo(toCalendar)) {
        throw new IllegalArgumentException("can not format on two different calendars");
    }
    Object[] items = getPatternItems();
    int diffBegin = -1;
    int diffEnd = -1;
    try {
        for (int i = 0; i < items.length; i++) {
            if (diffCalFieldValue(fromCalendar, toCalendar, items, i)) {
                diffBegin = i;
                break;
            }
        }
        if (diffBegin == -1) {
            return format(fromCalendar, appendTo, pos);
        }
        for (int i = items.length - 1; i >= diffBegin; i--) {
            if (diffCalFieldValue(fromCalendar, toCalendar, items, i)) {
                diffEnd = i;
                break;
            }
        }
    } catch (IllegalArgumentException e) {
        throw new IllegalArgumentException(e.toString());
    }
    if (diffBegin == 0 && diffEnd == items.length - 1) {
        format(fromCalendar, appendTo, pos);
        appendTo.append(" C ");
        format(toCalendar, appendTo, pos);
        return appendTo;
    }
    int highestLevel = 1000;
    for (int i = diffBegin; i <= diffEnd; i++) {
        if (items[i] instanceof String) {
            continue;
        }
        PatternItem item = (PatternItem) items[i];
        char ch = item.type;
        int patternCharIndex = getIndexFromChar(ch);
        if (patternCharIndex == -1) {
            throw new IllegalArgumentException("Illegal pattern character " + "'" + ch + "' in \"" + pattern + '"');
        }
        if (patternCharIndex < highestLevel) {
            highestLevel = patternCharIndex;
        }
    }
    try {
        for (int i = 0; i < diffBegin; i++) {
            if (lowerLevel(items, i, highestLevel)) {
                diffBegin = i;
                break;
            }
        }
        for (int i = items.length - 1; i > diffEnd; i--) {
            if (lowerLevel(items, i, highestLevel)) {
                diffEnd = i;
                break;
            }
        }
    } catch (IllegalArgumentException e) {
        throw new IllegalArgumentException(e.toString());
    }
    if (diffBegin == 0 && diffEnd == items.length - 1) {
        format(fromCalendar, appendTo, pos);
        appendTo.append(" C ");
        format(toCalendar, appendTo, pos);
        return appendTo;
    }
    pos.setBeginIndex(0);
    pos.setEndIndex(0);
    DisplayContext capSetting = getContext(DisplayContext.Type.CAPITALIZATION);
    for (int i = 0; i <= diffEnd; i++) {
        if (items[i] instanceof String) {
            appendTo.append((String) items[i]);
        } else {
            PatternItem item = (PatternItem) items[i];
            if (useFastFormat) {
                subFormat(appendTo, item.type, item.length, appendTo.length(), i, capSetting, pos, fromCalendar);
            } else {
                appendTo.append(subFormat(item.type, item.length, appendTo.length(), i, capSetting, pos, fromCalendar));
            }
        }
    }
    appendTo.append(" C ");
    for (int i = diffBegin; i < items.length; i++) {
        if (items[i] instanceof String) {
            appendTo.append((String) items[i]);
        } else {
            PatternItem item = (PatternItem) items[i];
            if (useFastFormat) {
                subFormat(appendTo, item.type, item.length, appendTo.length(), i, capSetting, pos, toCalendar);
            } else {
                appendTo.append(subFormat(item.type, item.length, appendTo.length(), i, capSetting, pos, toCalendar));
            }
        }
    }
    return appendTo;
}

