boolean hasDecompBoundary(int c,boolean before){
    for (; ; ) {
        if (c < minDecompNoCP) {
            return true;
        }
        int norm16 = getNorm16(c);
        if (isHangul(norm16) || isDecompYesAndZeroCC(norm16)) {
            return true;
