boolean load(Reader reader){
    try {
        vtzlines = new LinkedList<String>();
        boolean eol = false;
        boolean start = false;
        boolean success = false;
        StringBuilder line = new StringBuilder();
        while (true) {
            int ch = reader.read();
            if (ch == -1) {
                if (start && line.toString().startsWith(ICAL_END_VTIMEZONE)) {
                    vtzlines.add(line.toString());
                    success = true;
                }
                break;
            }
            if (ch == 0x0D) {
                continue;
            }
            if (eol) {
                if (ch != 0x09 && ch != 0x20) {
                    if (start) {
                        if (line.length() > 0) {
                            vtzlines.add(line.toString());
                        }
                    }
                    line.setLength(0);
                    if (ch != 0x0A) {
                        line.append((char) ch);
                    }
                }
                eol = false;
            } else {
                if (ch == 0x0A) {
                    eol = true;
                    if (start) {
                        if (line.toString().startsWith(ICAL_END_VTIMEZONE)) {
                            vtzlines.add(line.toString());
                            success = true;
                            break;
                        }
                    } else {
                        if (line.toString().startsWith(ICAL_BEGIN_VTIMEZONE)) {
                            vtzlines.add(line.toString());
                            line.setLength(0);
                            start = true;
                            eol = false;
                        }
                    }
                } else {
                    line.append((char) ch);
                }
            }
        }
        if (!success) {
            return false;
        }
    } catch (IOException ioe) {
        return false;
    }
    return parse();
}

