int match(CharsetDetector det,int[] commonChars,CharsetMatch match,CharsetDetector det,CharsetMatch match,CharsetDetector det,CharsetMatch match,CharsetDetector det,CharsetMatch match,CharsetDetector det,CharsetMatch match,CharsetDetector det){
    @SuppressWarnings("unused")
    int singleByteCharCount = 0;
    int doubleByteCharCount = 0;
    int commonCharCount = 0;
    int badCharCount = 0;
    int totalCharCount = 0;
    int confidence = 0;
    iteratedChar iter = new iteratedChar();
    detectBlock: {
        for (iter.reset(); nextChar(iter, det); ) {
            totalCharCount++;
            if (iter.error) {
                badCharCount++;
            } else {
                long cv = iter.charValue & 0xFFFFFFFFL;
                if (cv <= 0xff) {
                    singleByteCharCount++;
                } else {
                    doubleByteCharCount++;
                    if (commonChars != null) {
                        if (Arrays.binarySearch(commonChars, (int) cv) >= 0) {
                            commonCharCount++;
                        }
                    }
                }
            }
            if (badCharCount >= 2 && badCharCount * 5 >= doubleByteCharCount) {
                break detectBlock;
            }
        }
        if (doubleByteCharCount <= 10 && badCharCount == 0) {
            if (doubleByteCharCount == 0 && totalCharCount < 10) {
                confidence = 0;
            } else {
                confidence = 10;
            }
            break detectBlock;
        }
        if (doubleByteCharCount < 20 * badCharCount) {
            confidence = 0;
            break detectBlock;
        }
        if (commonChars == null) {
            confidence = 30 + doubleByteCharCount - 20 * badCharCount;
            if (confidence > 100) {
                confidence = 100;
            }
        } else {
            double maxVal = Math.log((float) doubleByteCharCount / 4);
            double scaleFactor = 90.0 / maxVal;
            confidence = (int) (Math.log(commonCharCount + 1) * scaleFactor + 10);
            confidence = Math.min(confidence, 100);
        }
    }
    return confidence;
}

