                element.integer = m_current_;
                element.value = m_name_.getAlgorithmName(m_algorithmIndex_, m_current_);
                m_groupIndex_ = -1;
                m_current_++;
                return true;
            }
        }
    }
    if (!iterateGroup(element, m_limit_)) {
