Result next(int inByte,Result next,byte[] s,int sIndex,int sLimit,Entry next){
    if (sIndex >= sLimit) {
        return current();
    }
    int pos = pos_;
    if (pos < 0) {
        return Result.NO_MATCH;
    }
    int length = remainingMatchLength_;
    for (; ; ) {
        byte inByte;
        for (; ; ) {
            if (sIndex == sLimit) {
                remainingMatchLength_ = length;
                pos_ = pos;
                int node;
                return (length < 0 && (node = (bytes_[pos] & 0xff)) >= kMinValueLead) ? valueResults_[node & kValueIsFinal] : Result.NO_VALUE;
            }
            inByte = s[sIndex++];
            if (length < 0) {
                remainingMatchLength_ = length;
                break;
            }
            if (inByte != bytes_[pos]) {
                stop();
                return Result.NO_MATCH;
            }
            ++pos;
            --length;
        }
        for (; ; ) {
            int node = bytes_[pos++] & 0xff;
            if (node < kMinLinearMatch) {
                Result result = branchNext(pos, node, inByte & 0xff);
                if (result == Result.NO_MATCH) {
                    return Result.NO_MATCH;
                }
                if (sIndex == sLimit) {
                    return result;
                }
                if (result == Result.FINAL_VALUE) {
                    stop();
                    return Result.NO_MATCH;
                }
                inByte = s[sIndex++];
                pos = pos_;
            } else if (node < kMinValueLead) {
                length = node - kMinLinearMatch;
                if (inByte != bytes_[pos]) {
                    stop();
                    return Result.NO_MATCH;
                }
                ++pos;
                --length;
                break;
            } else if ((node & kValueIsFinal) != 0) {
                stop();
                return Result.NO_MATCH;
            } else {
                pos = skipValue(pos, node);
                assert ((bytes_[pos] & 0xff) < kMinValueLead);
            }
        }
    }
}

