int spanWithStrings(CharSequence s,int start,int spanLimit,SpanCondition spanCondition){
    int initSize = 0;
    if (spanCondition == SpanCondition.CONTAINED) {
        initSize = maxLength16;
    }
    offsets.setMaxLength(initSize);
    int length = s.length();
    int pos = spanLimit, rest = length - spanLimit;
    int spanLength = spanLimit - start;
    int i, stringsLength = strings.size();
    for (; ; ) {
        if (spanCondition == SpanCondition.CONTAINED) {
            for (i = 0; i < stringsLength; ++i) {
                int overlap = spanLengths[i];
                if (overlap == ALL_CP_CONTAINED) {
                    continue;
                }
                String string = strings.get(i);
                int length16 = string.length();
                if (overlap >= LONG_SPAN) {
                    overlap = length16;
                    overlap = string.offsetByCodePoints(overlap, -1);
                }
                if (overlap > spanLength) {
                    overlap = spanLength;
                }
                int inc = length16 - overlap;
                for (; ; ) {
                    if (inc > rest) {
                        break;
                    }
                    if (!offsets.containsOffset(inc) && matches16CPB(s, pos - overlap, length, string, length16)) {
                        if (inc == rest) {
                            return length;
                        }
                        offsets.addOffset(inc);
                    }
                    if (overlap == 0) {
                        break;
                    }
                    --overlap;
                    ++inc;
                }
            }
        } else {
            int maxInc = 0, maxOverlap = 0;
            for (i = 0; i < stringsLength; ++i) {
                int overlap = spanLengths[i];
                String string = strings.get(i);
                int length16 = string.length();
                if (overlap >= LONG_SPAN) {
                    overlap = length16;
                }
                if (overlap > spanLength) {
                    overlap = spanLength;
                }
                int inc = length16 - overlap;
                for (; ; ) {
                    if (inc > rest || overlap < maxOverlap) {
                        break;
                    }
                    if ((overlap > maxOverlap || inc > maxInc) && matches16CPB(s, pos - overlap, length, string, length16)) {
                        maxInc = inc;
                        maxOverlap = overlap;
                        break;
                    }
                    --overlap;
                    ++inc;
                }
            }
            if (maxInc != 0 || maxOverlap != 0) {
                pos += maxInc;
                rest -= maxInc;
                if (rest == 0) {
                    return length;
                }
                spanLength = 0;
                continue;
            }
        }
        if (spanLength != 0 || pos == 0) {
            if (offsets.isEmpty()) {
                return pos;
            }
        } else {
            if (offsets.isEmpty()) {
                spanLimit = spanSet.span(s, pos, SpanCondition.CONTAINED);
                spanLength = spanLimit - pos;
                if (spanLength == rest || spanLength == 0) {
                    return spanLimit;
                }
                pos += spanLength;
                rest -= spanLength;
                continue;
            } else {
                spanLength = spanOne(spanSet, s, pos, rest);
                if (spanLength > 0) {
                    if (spanLength == rest) {
                        return length;
                    }
                    pos += spanLength;
                    rest -= spanLength;
                    offsets.shift(spanLength);
                    spanLength = 0;
                    continue;
                }
            }
        }
        int minOffset = offsets.popMinimum(null);
        pos += minOffset;
        rest -= minOffset;
        spanLength = 0;
    }
}

