boolean subparse(String text,ParsePosition parsePosition,DigitList digits,boolean status,Currency currency,String negPrefix,String negSuffix,String posPrefix,String posSuffix,boolean parseComplexCurrency,int type){
    int position = parsePosition.getIndex();
    int oldStart = parsePosition.getIndex();
    if (formatWidth > 0 && padPosition == PAD_BEFORE_PREFIX) {
        position = skipPadding(text, position);
    }
    int posMatch = compareAffix(text, position, false, true, posPrefix, parseComplexCurrency, type, currency);
    int negMatch = compareAffix(text, position, true, true, negPrefix, parseComplexCurrency, type, currency);
    if (posMatch >= 0 && negMatch >= 0) {
        if (posMatch > negMatch) {
            negMatch = -1;
        } else if (negMatch > posMatch) {
            posMatch = -1;
        }
    }
    if (posMatch >= 0) {
        position += posMatch;
    } else if (negMatch >= 0) {
        position += negMatch;
    } else {
        parsePosition.setErrorIndex(position);
        return false;
    }
    if (formatWidth > 0 && padPosition == PAD_AFTER_PREFIX) {
        position = skipPadding(text, position);
    }
    status[STATUS_INFINITE] = false;
    if (text.regionMatches(position, symbols.getInfinity(), 0, symbols.getInfinity().length())) {
        position += symbols.getInfinity().length();
        status[STATUS_INFINITE] = true;
    } else {
        digits.decimalAt = digits.count = 0;
        String decimal = (currencySignCount == CURRENCY_SIGN_COUNT_ZERO) ? symbols.getDecimalSeparatorString() : symbols.getMonetaryDecimalSeparatorString();
        String grouping = (currencySignCount == CURRENCY_SIGN_COUNT_ZERO) ? symbols.getGroupingSeparatorString() : symbols.getMonetaryGroupingSeparatorString();
        String exponentSep = symbols.getExponentSeparator();
        boolean sawDecimal = false;
        boolean sawGrouping = false;
        boolean sawDigit = false;
        long exponent = 0;
        boolean strictParse = isParseStrict();
        boolean strictFail = false;
        int lastGroup = -1;
        int groupedDigitCount = 0;
        int gs2 = groupingSize2 == 0 ? groupingSize : groupingSize2;
        UnicodeSet decimalEquiv = skipExtendedSeparatorParsing ? UnicodeSet.EMPTY : getEquivalentDecimals(decimal, strictParse);
        UnicodeSet groupEquiv = skipExtendedSeparatorParsing ? UnicodeSet.EMPTY : (strictParse ? strictDefaultGroupingSeparators : defaultGroupingSeparators);
        int digitCount = 0;
        int backup = -1;
        int[] parsedDigit = { -1 };
        while (position < text.length()) {
            int matchLen = matchesDigit(text, position, parsedDigit);
            if (matchLen > 0) {
                if (backup != -1) {
                    if (strictParse) {
                        if ((lastGroup != -1 && groupedDigitCount != gs2) || (lastGroup == -1 && groupedDigitCount > gs2)) {
                            strictFail = true;
                            break;
                        }
                    }
                    lastGroup = backup;
                    groupedDigitCount = 0;
                }
                groupedDigitCount++;
                position += matchLen;
                backup = -1;
                sawDigit = true;
                if (parsedDigit[0] == 0 && digits.count == 0) {
                    if (!sawDecimal) {
                        continue;
                    }
                    --digits.decimalAt;
                } else {
                    ++digitCount;
                    digits.append((char) (parsedDigit[0] + '0'));
                }
                continue;
            }
            int decimalStrLen = decimal.length();
            if (text.regionMatches(position, decimal, 0, decimalStrLen)) {
                if (strictParse) {
                    if (backup != -1 || (lastGroup != -1 && groupedDigitCount != groupingSize)) {
                        strictFail = true;
                        break;
                    }
                }
                if (isParseIntegerOnly() || sawDecimal) {
                    break;
                }
                digits.decimalAt = digitCount;
                sawDecimal = true;
                position += decimalStrLen;
                continue;
            }
            if (isGroupingUsed()) {
                int groupingStrLen = grouping.length();
                if (text.regionMatches(position, grouping, 0, groupingStrLen)) {
                    if (sawDecimal) {
                        break;
                    }
                    if (strictParse) {
                        if ((!sawDigit || backup != -1)) {
                            strictFail = true;
                            break;
                        }
                    }
                    backup = position;
                    position += groupingStrLen;
                    sawGrouping = true;
                    continue;
                }
            }
            int cp = text.codePointAt(position);
            if (!sawDecimal && decimalEquiv.contains(cp)) {
                if (strictParse) {
                    if (backup != -1 || (lastGroup != -1 && groupedDigitCount != groupingSize)) {
                        strictFail = true;
                        break;
                    }
                }
                if (isParseIntegerOnly()) {
                    break;
                }
                digits.decimalAt = digitCount;
                decimal = String.valueOf(Character.toChars(cp));
                sawDecimal = true;
                position += Character.charCount(cp);
                continue;
            }
            if (isGroupingUsed() && !sawGrouping && groupEquiv.contains(cp)) {
                if (sawDecimal) {
                    break;
                }
                if (strictParse) {
                    if ((!sawDigit || backup != -1)) {
                        strictFail = true;
                        break;
                    }
                }
                grouping = String.valueOf(Character.toChars(cp));
                backup = position;
                position += Character.charCount(cp);
                sawGrouping = true;
                continue;
            }
            int exponentSepStrLen = exponentSep.length();
            if (text.regionMatches(true, position, exponentSep, 0, exponentSepStrLen)) {
                boolean negExp = false;
                int pos = position + exponentSep.length();
                if (pos < text.length()) {
                    String plusSign = symbols.getPlusSignString();
                    String minusSign = symbols.getMinusSignString();
                    if (text.regionMatches(pos, plusSign, 0, plusSign.length())) {
                        pos += plusSign.length();
                    } else if (text.regionMatches(pos, minusSign, 0, minusSign.length())) {
                        pos += minusSign.length();
                        negExp = true;
                    }
                }
                DigitList exponentDigits = new DigitList();
                exponentDigits.count = 0;
                while (pos < text.length()) {
                    int digitMatchLen = matchesDigit(text, pos, parsedDigit);
                    if (digitMatchLen > 0) {
                        exponentDigits.append((char) (parsedDigit[0] + '0'));
                        pos += digitMatchLen;
                    } else {
                        break;
                    }
                }
                if (exponentDigits.count > 0) {
                    if (strictParse && sawGrouping) {
                        strictFail = true;
                        break;
                    }
                    if (exponentDigits.count > 10) {
                        if (negExp) {
                            status[STATUS_UNDERFLOW] = true;
                        } else {
                            status[STATUS_INFINITE] = true;
                        }
                    } else {
                        exponentDigits.decimalAt = exponentDigits.count;
                        exponent = exponentDigits.getLong();
                        if (negExp) {
                            exponent = -exponent;
                        }
                    }
                    position = pos;
                }
                break;
            }
            break;
        }
        if (digits.decimalAt == 0 && isDecimalPatternMatchRequired()) {
            if (this.formatPattern.indexOf(decimal) != -1) {
                parsePosition.setIndex(oldStart);
                parsePosition.setErrorIndex(position);
                return false;
            }
        }
        if (backup != -1)
            position = backup;
        if (!sawDecimal) {
            digits.decimalAt = digitCount;
        }
        if (strictParse && !sawDecimal) {
            if (lastGroup != -1 && groupedDigitCount != groupingSize) {
                strictFail = true;
            }
        }
        if (strictFail) {
            parsePosition.setIndex(oldStart);
            parsePosition.setErrorIndex(position);
            return false;
        }
        exponent += digits.decimalAt;
        if (exponent < -getParseMaxDigits()) {
            status[STATUS_UNDERFLOW] = true;
        } else if (exponent > getParseMaxDigits()) {
            status[STATUS_INFINITE] = true;
        } else {
            digits.decimalAt = (int) exponent;
        }
        if (!sawDigit && digitCount == 0) {
            parsePosition.setIndex(oldStart);
            parsePosition.setErrorIndex(oldStart);
            return false;
        }
    }
    if (formatWidth > 0 && padPosition == PAD_BEFORE_SUFFIX) {
        position = skipPadding(text, position);
    }
    if (posMatch >= 0) {
        posMatch = compareAffix(text, position, false, false, posSuffix, parseComplexCurrency, type, currency);
    }
    if (negMatch >= 0) {
        negMatch = compareAffix(text, position, true, false, negSuffix, parseComplexCurrency, type, currency);
    }
    if (posMatch >= 0 && negMatch >= 0) {
        if (posMatch > negMatch) {
            negMatch = -1;
        } else if (negMatch > posMatch) {
            posMatch = -1;
        }
    }
    if ((posMatch >= 0) == (negMatch >= 0)) {
        parsePosition.setErrorIndex(position);
        return false;
    }
    position += (posMatch >= 0 ? posMatch : negMatch);
    if (formatWidth > 0 && padPosition == PAD_AFTER_SUFFIX) {
        position = skipPadding(text, position);
    }
    parsePosition.setIndex(position);
    status[STATUS_POSITIVE] = (posMatch >= 0);
    if (parsePosition.getIndex() == oldStart) {
        parsePosition.setErrorIndex(position);
        return false;
    }
    return true;
}

Transliterator createFromRules(String ID,String rules,int dir){
    Transliterator t = null;
    TransliteratorParser parser = new TransliteratorParser();
    parser.parse(rules, dir);
    if (parser.idBlockVector.size() == 0 && parser.dataVector.size() == 0) {
        t = new NullTransliterator();
    } else if (parser.idBlockVector.size() == 0 && parser.dataVector.size() == 1) {
        t = new RuleBasedTransliterator(ID, parser.dataVector.get(0), parser.compoundFilter);
    } else if (parser.idBlockVector.size() == 1 && parser.dataVector.size() == 0) {
        if (parser.compoundFilter != null) {
            t = getInstance(parser.compoundFilter.toPattern(false) + ";" + parser.idBlockVector.get(0));
        } else {
            t = getInstance(parser.idBlockVector.get(0));
        }
        if (t != null) {
            t.setID(ID);
        }
    } else {
        List<Transliterator> transliterators = new ArrayList<Transliterator>();
        int passNumber = 1;
        int limit = Math.max(parser.idBlockVector.size(), parser.dataVector.size());
        for (int i = 0; i < limit; i++) {
            if (i < parser.idBlockVector.size()) {
                String idBlock = parser.idBlockVector.get(i);
                if (idBlock.length() > 0) {
                    Transliterator temp = getInstance(idBlock);
                    if (!(temp instanceof NullTransliterator))
                        transliterators.add(getInstance(idBlock));
                }
            }
            if (i < parser.dataVector.size()) {
                Data data = parser.dataVector.get(i);
                transliterators.add(new RuleBasedTransliterator("%Pass" + passNumber++, data, null));
            }
        }
        t = new CompoundTransliterator(transliterators, passNumber - 1);
        t.setID(ID);
        if (parser.compoundFilter != null) {
            t.setFilter(parser.compoundFilter);
        }
    }
    return t;
}

