boolean hasRelation(SortedSet<T> a,int allow,SortedSet<T> b){
    if (allow < NONE || allow > ANY) {
        throw new IllegalArgumentException("Relation " + allow + " out of range");
    }
    boolean anb = (allow & A_NOT_B) != 0;
    boolean ab = (allow & A_AND_B) != 0;
    boolean bna = (allow & B_NOT_A) != 0;
    switch(allow) {
        case CONTAINS:
            if (a.size() < b.size())
                return false;
            break;
        case ISCONTAINED:
            if (a.size() > b.size())
                return false;
            break;
        case EQUALS:
            if (a.size() != b.size())
                return false;
            break;
    }
    if (a.size() == 0) {
        if (b.size() == 0)
            return true;
        return bna;
    } else if (b.size() == 0) {
        return anb;
    }
    Iterator<? extends T> ait = a.iterator();
    Iterator<? extends T> bit = b.iterator();
    T aa = ait.next();
    T bb = bit.next();
    while (true) {
        int comp = aa.compareTo(bb);
        if (comp == 0) {
            if (!ab)
                return false;
            if (!ait.hasNext()) {
                if (!bit.hasNext())
                    return true;
                return bna;
            } else if (!bit.hasNext()) {
                return anb;
            }
            aa = ait.next();
            bb = bit.next();
        } else if (comp < 0) {
            if (!anb)
                return false;
            if (!ait.hasNext()) {
                return bna;
            }
            aa = ait.next();
        } else {
            if (!bna)
                return false;
            if (!bit.hasNext()) {
                return anb;
            }
            bb = bit.next();
        }
    }
}

boolean parseCompoundID(String id,int dir,StringBuffer canonID,List<SingleID> list,UnicodeSet[] globalFilter){
    int[] pos = new int[] { 0 };
    int[] withParens = new int[1];
    list.clear();
    UnicodeSet filter;
    globalFilter[0] = null;
    canonID.setLength(0);
    withParens[0] = 0;
    filter = parseGlobalFilter(id, pos, dir, withParens, canonID);
    if (filter != null) {
        if (!Utility.parseChar(id, pos, ID_DELIM)) {
            canonID.setLength(0);
            pos[0] = 0;
        }
        if (dir == FORWARD) {
            globalFilter[0] = filter;
        }
    }
    boolean sawDelimiter = true;
    for (; ; ) {
        SingleID single = parseSingleID(id, pos, dir);
        if (single == null) {
            break;
        }
        if (dir == FORWARD) {
            list.add(single);
        } else {
            list.add(0, single);
        }
        if (!Utility.parseChar(id, pos, ID_DELIM)) {
            sawDelimiter = false;
            break;
        }
    }
    if (list.size() == 0) {
        return false;
    }
    for (int i = 0; i < list.size(); ++i) {
        SingleID single = list.get(i);
        canonID.append(single.canonID);
        if (i != (list.size() - 1)) {
            canonID.append(ID_DELIM);
        }
    }
    if (sawDelimiter) {
        withParens[0] = 1;
        filter = parseGlobalFilter(id, pos, dir, withParens, canonID);
        if (filter != null) {
            Utility.parseChar(id, pos, ID_DELIM);
            if (dir == REVERSE) {
                globalFilter[0] = filter;
            }
        }
    }
    pos[0] = PatternProps.skipWhiteSpace(id, pos[0]);
    if (pos[0] != id.length()) {
        return false;
    }
    return true;
}

