int match(byte[] text,int textLen,byte[][] escapeSequences,CharsetMatch match,CharsetDetector det,CharsetMatch match,CharsetDetector det,CharsetMatch match,CharsetDetector det){
    int i, j;
    int escN;
    int hits = 0;
    int misses = 0;
    int shifts = 0;
    int quality;
    scanInput: for (i = 0; i < textLen; i++) {
        if (text[i] == 0x1b) {
            checkEscapes: for (escN = 0; escN < escapeSequences.length; escN++) {
                byte[] seq = escapeSequences[escN];
                if ((textLen - i) < seq.length) {
                    continue checkEscapes;
                }
                for (j = 1; j < seq.length; j++) {
                    if (seq[j] != text[i + j]) {
                        continue checkEscapes;
                    }
                }
                hits++;
                i += seq.length - 1;
                continue scanInput;
            }
            misses++;
        }
        if (text[i] == 0x0e || text[i] == 0x0f) {
            shifts++;
        }
    }
    if (hits == 0) {
        return 0;
    }
    quality = (100 * hits - 100 * misses) / (hits + misses);
    if (hits + shifts < 5) {
        quality -= (5 - (hits + shifts)) * 10;
    }
    if (quality < 0) {
        quality = 0;
    }
    return quality;
}

