void freeze(){
    int n = ruleVector.size();
    index = new int[257];
    List<TransliterationRule> v = new ArrayList<TransliterationRule>(2 * n);
    int[] indexValue = new int[n];
    for (int j = 0; j < n; ++j) {
        TransliterationRule r = ruleVector.get(j);
        indexValue[j] = r.getIndexValue();
    }
    for (int x = 0; x < 256; ++x) {
        index[x] = v.size();
        for (int j = 0; j < n; ++j) {
            if (indexValue[j] >= 0) {
                if (indexValue[j] == x) {
                    v.add(ruleVector.get(j));
                }
            } else {
                TransliterationRule r = ruleVector.get(j);
                if (r.matchesIndexValue(x)) {
                    v.add(r);
                }
            }
        }
    }
    index[256] = v.size();
    rules = new TransliterationRule[v.size()];
    v.toArray(rules);
    StringBuilder errors = null;
    for (int x = 0; x < 256; ++x) {
        for (int j = index[x]; j < index[x + 1] - 1; ++j) {
            TransliterationRule r1 = rules[j];
            for (int k = j + 1; k < index[x + 1]; ++k) {
                TransliterationRule r2 = rules[k];
                if (r1.masks(r2)) {
                    if (errors == null) {
                        errors = new StringBuilder();
                    } else {
                        errors.append("\n");
                    }
                    errors.append("Rule " + r1 + " masks " + r2);
                }
            }
        }
    }
    if (errors != null) {
        throw new IllegalArgumentException(errors.toString());
    }
}

byte getBaseDirection(CharSequence paragraph){
    if (paragraph == null || paragraph.length() == 0) {
        return NEUTRAL;
    }
    int length = paragraph.length();
    int c;
    byte direction;
    for (int i = 0; i < length; ) {
        c = UCharacter.codePointAt(paragraph, i);
        direction = UCharacter.getDirectionality(c);
        if (direction == UCharacterDirection.LEFT_TO_RIGHT) {
            return LTR;
        } else if (direction == UCharacterDirection.RIGHT_TO_LEFT || direction == UCharacterDirection.RIGHT_TO_LEFT_ARABIC) {
            return RTL;
        }
        i = UCharacter.offsetByCodePoints(paragraph, i, 1);
    }
    return NEUTRAL;
}

