String compileToStringMinMaxArguments(CharSequence pattern,StringBuilder sb,int min,int max){
    if (min <= 2 && 2 <= max) {
        for (String[] pair : COMMON_PATTERNS) {
            if (pair[0].contentEquals(pattern)) {
                assert pair[1].charAt(0) == 2;
                return pair[1];
            }
        }
    }
    int patternLength = pattern.length();
    sb.ensureCapacity(patternLength);
    sb.setLength(1);
    int textLength = 0;
    int maxArg = -1;
    boolean inQuote = false;
    for (int i = 0; i < patternLength; ) {
        char c = pattern.charAt(i++);
        if (c == '\'') {
            if (i < patternLength && (c = pattern.charAt(i)) == '\'') {
                ++i;
            } else if (inQuote) {
                inQuote = false;
                continue;
            } else if (c == '{' || c == '}') {
                ++i;
                inQuote = true;
            } else {
                c = '\'';
            }
        } else if (!inQuote && c == '{') {
            if (textLength > 0) {
                sb.setCharAt(sb.length() - textLength - 1, (char) (ARG_NUM_LIMIT + textLength));
                textLength = 0;
            }
            int argNumber;
            if ((i + 1) < patternLength && 0 <= (argNumber = pattern.charAt(i) - '0') && argNumber <= 9 && pattern.charAt(i + 1) == '}') {
                i += 2;
            } else {
                int argStart = i - 1;
                argNumber = -1;
                if (i < patternLength && '1' <= (c = pattern.charAt(i++)) && c <= '9') {
                    argNumber = c - '0';
                    while (i < patternLength && '0' <= (c = pattern.charAt(i++)) && c <= '9') {
                        argNumber = argNumber * 10 + (c - '0');
                        if (argNumber >= ARG_NUM_LIMIT) {
                            break;
                        }
                    }
                }
                if (argNumber < 0 || c != '}') {
                    throw new IllegalArgumentException("Argument syntax error in pattern \"" + pattern + "\" at index " + argStart + ": " + pattern.subSequence(argStart, i));
                }
            }
            if (argNumber > maxArg) {
                maxArg = argNumber;
            }
            sb.append((char) argNumber);
            continue;
        }
        if (textLength == 0) {
            sb.append(SEGMENT_LENGTH_ARGUMENT_CHAR);
        }
        sb.append(c);
        if (++textLength == MAX_SEGMENT_LENGTH) {
            textLength = 0;
        }
    }
    if (textLength > 0) {
        sb.setCharAt(sb.length() - textLength - 1, (char) (ARG_NUM_LIMIT + textLength));
    }
    int argCount = maxArg + 1;
    if (argCount < min) {
        throw new IllegalArgumentException("Fewer than minimum " + min + " arguments in pattern \"" + pattern + "\"");
    }
    if (argCount > max) {
        throw new IllegalArgumentException("More than maximum " + max + " arguments in pattern \"" + pattern + "\"");
    }
    sb.setCharAt(0, (char) argCount);
    return sb.toString();
}

