        if (rulesetNames[i].equals(name)) {
            format = i;
            longForm = i == 1 || i == 3;
            break;
        }
    }
    if (longForm) {
        for (int i = buf.indexOf("*"); i != -1; i = buf.indexOf("*", i)) {
            buf.delete(i, i + 1);
        }
        return;
    }
    final String DIAN = "c";
    final String[][] markers = { { "f", "|", "", "" }, { "", "", "", "" }, { "f", "|", "", "" } };
    {
        String[] m = markers[format];
        for (int i = 0; i < m.length - 1; ++i) {
            int n = buf.indexOf(m[i]);
            if (n != -1) {
                buf.insert(n + m[i].length(), '|');
            }
        }
    }
    int x = buf.indexOf(DIAN);
    if (x == -1) {
        x = buf.length();
    }
    int s = 0;
    int n = -1;
    String ling = markers[format][3];
    while (x >= 0) {
        int m = buf.lastIndexOf("|", x);
        int nn = buf.lastIndexOf(ling, x);
        int ns = 0;
        if (nn > m) {
            ns = (nn > 0 && buf.charAt(nn - 1) != '*') ? 2 : 1;
        }
        x = m - 1;
        switch(s * 3 + ns) {
            case 0:
                s = ns;
                n = -1;
                break;
            case 1:
                s = ns;
                n = nn;
                break;
            case 2:
                s = ns;
                n = -1;
                break;
            case 3:
                s = ns;
                n = -1;
                break;
            case 4:
                buf.delete(nn - 1, nn + ling.length());
                s = 0;
                n = -1;
                break;
            case 5:
                buf.delete(n - 1, n + ling.length());
                s = ns;
                n = -1;
                break;
            case 6:
                s = ns;
                n = -1;
                break;
            case 7:
                buf.delete(nn - 1, nn + ling.length());
                s = 0;
                n = -1;
                break;
            case 8:
                s = ns;
                n = -1;
                break;
            default:
                throw new IllegalStateException();
        }
    }
    for (int i = buf.length(); --i >= 0; ) {
        char c = buf.charAt(i);
        if (c == '*' || c == '|') {
            buf.delete(i, i + 1);
        }
    }
}

