List<String> initLabels(){
    Normalizer2 nfkdNormalizer = Normalizer2.getNFKDInstance();
    List<String> indexCharacters = new ArrayList<String>();
    String firstScriptBoundary = firstCharsInScripts.get(0);
    String overflowBoundary = firstCharsInScripts.get(firstCharsInScripts.size() - 1);
    for (String item : initialLabels) {
        boolean checkDistinct;
        if (!UTF16.hasMoreCodePointsThan(item, 1)) {
            checkDistinct = false;
        } else if (item.charAt(item.length() - 1) == '*' && item.charAt(item.length() - 2) != '*') {
            item = item.substring(0, item.length() - 1);
            checkDistinct = false;
        } else {
            checkDistinct = true;
        }
        if (collatorPrimaryOnly.compare(item, firstScriptBoundary) < 0) {
        } else if (collatorPrimaryOnly.compare(item, overflowBoundary) >= 0) {
        } else if (checkDistinct && collatorPrimaryOnly.compare(item, separated(item)) == 0) {
        } else {
            int insertionPoint = Collections.binarySearch(indexCharacters, item, collatorPrimaryOnly);
            if (insertionPoint < 0) {
                indexCharacters.add(~insertionPoint, item);
            } else {
                String itemAlreadyIn = indexCharacters.get(insertionPoint);
                if (isOneLabelBetterThanOther(nfkdNormalizer, item, itemAlreadyIn)) {
                    indexCharacters.set(insertionPoint, item);
                }
            }
        }
    }
    final int size = indexCharacters.size() - 1;
    if (size > maxLabelCount) {
        int count = 0;
        int old = -1;
        for (Iterator<String> it = indexCharacters.iterator(); it.hasNext(); ) {
            ++count;
            it.next();
            final int bump = count * maxLabelCount / size;
            if (bump == old) {
                it.remove();
            } else {
                old = bump;
            }
        }
    }
    return indexCharacters;
}

void parseRules(RuleBody ruleArray,int dir){
    boolean parsingIDs = true;
    int ruleCount = 0;
    dataVector = new ArrayList<Data>();
    idBlockVector = new ArrayList<String>();
    curData = null;
    direction = dir;
    compoundFilter = null;
    variablesVector = new ArrayList<Object>();
    variableNames = new HashMap<String, char[]>();
    parseData = new ParseData();
    List<RuntimeException> errors = new ArrayList<RuntimeException>();
    int errorCount = 0;
    ruleArray.reset();
    StringBuilder idBlockResult = new StringBuilder();
    this.compoundFilter = null;
    int compoundFilterOffset = -1;
    main: for (; ; ) {
        String rule = ruleArray.nextLine();
        if (rule == null) {
            break;
        }
        int pos = 0;
        int limit = rule.length();
        while (pos < limit) {
            char c = rule.charAt(pos++);
            if (PatternProps.isWhiteSpace(c)) {
                continue;
            }
            if (c == RULE_COMMENT_CHAR) {
                pos = rule.indexOf("\n", pos) + 1;
                if (pos == 0) {
                    break;
                }
                continue;
            }
            if (c == END_OF_RULE)
                continue;
            try {
                ++ruleCount;
                --pos;
                if ((pos + ID_TOKEN_LEN + 1) <= limit && rule.regionMatches(pos, ID_TOKEN, 0, ID_TOKEN_LEN)) {
                    pos += ID_TOKEN_LEN;
                    c = rule.charAt(pos);
                    while (PatternProps.isWhiteSpace(c) && pos < limit) {
                        ++pos;
                        c = rule.charAt(pos);
                    }
                    int[] p = new int[] { pos };
                    if (!parsingIDs) {
                        if (curData != null) {
                            if (direction == Transliterator.FORWARD)
                                dataVector.add(curData);
                            else
                                dataVector.add(0, curData);
                            curData = null;
                        }
                        parsingIDs = true;
                    }
                    TransliteratorIDParser.SingleID id = TransliteratorIDParser.parseSingleID(rule, p, direction);
                    if (p[0] != pos && Utility.parseChar(rule, p, END_OF_RULE)) {
                        if (direction == Transliterator.FORWARD) {
                            idBlockResult.append(id.canonID).append(END_OF_RULE);
                        } else {
                            idBlockResult.insert(0, id.canonID + END_OF_RULE);
                        }
                    } else {
                        int[] withParens = new int[] { -1 };
                        UnicodeSet f = TransliteratorIDParser.parseGlobalFilter(rule, p, direction, withParens, null);
                        if (f != null && Utility.parseChar(rule, p, END_OF_RULE)) {
                            if ((direction == Transliterator.FORWARD) == (withParens[0] == 0)) {
                                if (compoundFilter != null) {
                                    syntaxError("Multiple global filters", rule, pos);
                                }
                                compoundFilter = f;
                                compoundFilterOffset = ruleCount;
                            }
                        } else {
                            syntaxError("Invalid ::ID", rule, pos);
                        }
                    }
                    pos = p[0];
                } else {
                    if (parsingIDs) {
                        if (direction == Transliterator.FORWARD)
                            idBlockVector.add(idBlockResult.toString());
                        else
                            idBlockVector.add(0, idBlockResult.toString());
                        idBlockResult.delete(0, idBlockResult.length());
                        parsingIDs = false;
                        curData = new RuleBasedTransliterator.Data();
                        setVariableRange(0xF000, 0xF8FF);
                    }
                    if (resemblesPragma(rule, pos, limit)) {
                        int ppp = parsePragma(rule, pos, limit);
                        if (ppp < 0) {
                            syntaxError("Unrecognized pragma", rule, pos);
                        }
                        pos = ppp;
                    } else {
                        pos = parseRule(rule, pos, limit);
                    }
                }
            } catch (IllegalArgumentException e) {
                if (errorCount == 30) {
                    IllegalIcuArgumentException icuEx = new IllegalIcuArgumentException("\nMore than 30 errors; further messages squelched");
                    icuEx.initCause(e);
                    errors.add(icuEx);
                    break main;
                }
                e.fillInStackTrace();
                errors.add(e);
                ++errorCount;
                pos = ruleEnd(rule, pos, limit) + 1;
            }
        }
    }
    if (parsingIDs && idBlockResult.length() > 0) {
        if (direction == Transliterator.FORWARD)
            idBlockVector.add(idBlockResult.toString());
        else
            idBlockVector.add(0, idBlockResult.toString());
    } else if (!parsingIDs && curData != null) {
        if (direction == Transliterator.FORWARD)
            dataVector.add(curData);
        else
            dataVector.add(0, curData);
    }
    for (int i = 0; i < dataVector.size(); i++) {
        Data data = dataVector.get(i);
        data.variables = new Object[variablesVector.size()];
        variablesVector.toArray(data.variables);
        data.variableNames = new HashMap<String, char[]>();
        data.variableNames.putAll(variableNames);
    }
    variablesVector = null;
    try {
        if (compoundFilter != null) {
            if ((direction == Transliterator.FORWARD && compoundFilterOffset != 1) || (direction == Transliterator.REVERSE && compoundFilterOffset != ruleCount)) {
                throw new IllegalIcuArgumentException("Compound filters misplaced");
            }
        }
        for (int i = 0; i < dataVector.size(); i++) {
            Data data = dataVector.get(i);
            data.ruleSet.freeze();
        }
        if (idBlockVector.size() == 1 && (idBlockVector.get(0)).length() == 0)
            idBlockVector.remove(0);
    } catch (IllegalArgumentException e) {
        e.fillInStackTrace();
        errors.add(e);
    }
    if (errors.size() != 0) {
        for (int i = errors.size() - 1; i > 0; --i) {
            RuntimeException previous = errors.get(i - 1);
            while (previous.getCause() != null) {
                previous = (RuntimeException) previous.getCause();
            }
            previous.initCause(errors.get(i));
        }
        throw errors.get(0);
    }
}

