Object[] getPatternItems(){
    if (patternItems != null) {
        return patternItems;
    }
    patternItems = PARSED_PATTERN_CACHE.get(pattern);
    if (patternItems != null) {
        return patternItems;
    }
    boolean isPrevQuote = false;
    boolean inQuote = false;
    StringBuilder text = new StringBuilder();
    char itemType = 0;
    int itemLength = 1;
    List<Object> items = new ArrayList<Object>();
    for (int i = 0; i < pattern.length(); i++) {
        char ch = pattern.charAt(i);
        if (ch == '\'') {
            if (isPrevQuote) {
                text.append('\'');
                isPrevQuote = false;
            } else {
                isPrevQuote = true;
                if (itemType != 0) {
                    items.add(new PatternItem(itemType, itemLength));
                    itemType = 0;
                }
            }
            inQuote = !inQuote;
        } else {
            isPrevQuote = false;
            if (inQuote) {
                text.append(ch);
            } else {
                if (isSyntaxChar(ch)) {
                    if (ch == itemType) {
                        itemLength++;
                    } else {
                        if (itemType == 0) {
                            if (text.length() > 0) {
                                items.add(text.toString());
                                text.setLength(0);
                            }
                        } else {
                            items.add(new PatternItem(itemType, itemLength));
                        }
                        itemType = ch;
                        itemLength = 1;
                    }
                } else {
                    if (itemType != 0) {
                        items.add(new PatternItem(itemType, itemLength));
                        itemType = 0;
                    }
                    text.append(ch);
                }
            }
        }
    }
    if (itemType == 0) {
        if (text.length() > 0) {
            items.add(text.toString());
            text.setLength(0);
        }
    } else {
        items.add(new PatternItem(itemType, itemLength));
    }
    patternItems = items.toArray(new Object[items.size()]);
    PARSED_PATTERN_CACHE.put(pattern, patternItems);
    return patternItems;
}

